      title: 'interface - Result-1',
      body:
        "\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  Result\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/graphql/existence.query.ts\n        \n\n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n                        \n                    \n                    \n                        \n                            \n                                \n                                        repository\n                                \n                            \n                        \n                    \n                \n            \n        \n\n\n\n            \n                Properties\n                    \n                        \n                                \n                                    \n                                        \n                                        repository\n                                    \n                                \n                                \n                                    \n                                        repository:     literal type\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :     literal type\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n            \n    \n\n\n    \n        import { Injectable } from '@angular/core';\nimport { MappingQuery } from '@graphql/mapping-query';\nimport gql from 'graphql-tag';\nimport { ApolloQueryResult, QueryOptions, WatchQueryOptions } from 'apollo-client';\nimport { Observable, of, throwError } from 'rxjs';\nimport { catchError } from 'rxjs/operators';\n\nexport interface Variables {\n  name: string;\n  owner: string;\n  branch: string;\n}\n\nexport interface Result {\n  repository: {\n    ref: string | null;\n  };\n}\n\nexport interface ExistenceResult {\n  exists: boolean;\n  error: string | undefined;\n}\n\n@Injectable({\n  providedIn: 'root'\n})\nexport class ExistenceQuery extends MappingQuery {\n  document = gql`\n    query ExistenceQuery($name: String!, $owner: String!, $branch: String!) {\n      repository(name: $name, owner: $owner) {\n        ref(qualifiedName: $branch) {\n          name\n        }\n      }\n    }\n  `;\n\n  watchMapped(\n    variables?: Variables,\n    options?: WatchQueryOptions\n  ): Observable {\n    return super\n      .watchMapped(variables, options)\n      .pipe(catchError(err => this.recoverError(err)));\n  }\n\n  fetchMapped(\n    variables?: Variables,\n    options?: QueryOptions\n  ): Observable {\n    return super\n      .fetchMapped(variables, options)\n      .pipe(catchError(err => this.recoverError(err)));\n  }\n\n  recoverError(err: any): Observable {\n    if (err.message.startsWith('GraphQL error:')) {\n      return of({\n        exists: false,\n        error: err.message\n      });\n    } else {\n      return throwError(err);\n    }\n  }\n\n  protected mapper(result: ApolloQueryResult): ExistenceResult {\n    if (result.data.repository == null) {\n      return {\n        exists: false,\n        error: 'Unable to read repository.'\n      };\n    }\n    const exists = result.data.repository.ref !== null;\n    return {\n      exists,\n      error: exists ? undefined : 'Branch does not exist.'\n    };\n  }\n}\n\n    \n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"
